import { Link } from "react-router-dom";
import React from 'react'

const Navbar = () => {

  return (
    <div>
      <Link to='/search'><button>Search</button></Link>
      <Link to='/login'><button>Login</button></Link>
    </div>
  );
};

export default Navbar;
